import React, { Component } from "react";
import { NavLink } from "react-router-dom";
import { Menubar } from "primereact/menubar";
import { Button } from "primereact/button";

class Header extends Component {
  componentDidMount() {
    //const userCredentials = sessionStorage.getItem("data");
    // this.setState({
    //   userCredentials: sessionStorage.getItem("userData")
    // });
    //console.log(userCredentials[0].first_name);
  }

  constructor(props) {
    super(props);
    this.state = {
      redirect: false,
      userCredentials: sessionStorage.getItem("data"),
      items: [
        {
          label: "Users",
          icon: "pi pi-fw pi-user",
          url: "#",
          items: [
            {
              label: "Account settings",
              icon: "pi pi-fw pi-cog",
              url: "#"
            },
            {
              label: "Logout",
              icon: "pi pi-fw pi-power-off",
              url: "/admin/logout"
            }
          ]
        }
      ]
    };

    this.logout = this.logout.bind(this);
  }

  logout() {
    sessionStorage.setItem("data", "");
    sessionStorage.clear();
    this.setState({ redirect: true });
  }

  render() {
    return (
      <div className="p-grid">
        <div className="p-col-12">
          <Menubar model={this.state.items}>
            {/* <Button
            label="Logout"
            className="p-button p-button-secondary"
            icon="pi pi-power-off"
            onClick={this.logout}
          /> */}
          </Menubar>
          {this.state.userCredentials.map(user => (
            <pre>{user}</pre>
          ))}
        </div>
      </div>
    );
  }
}

export default Header;
